import React from 'react';

function DeliveryWork() {
  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold text-gray-800">Delivery Work</h1>
      <p className="mt-4 text-gray-600">Information and tasks related to delivery work will be displayed here.</p>
    </div>
  );
}

export default DeliveryWork;
